import React, { Component } from 'react';
import './App.css';
import Header from './Header.js';
import CitiesList from './CitiesList';
import LogIn from './LogIn/LogIn';

class App extends Component {
  render() {
    return (
      <div className="App">
          <Header />
          <CitiesList />
        <div>
          <LogIn />
        </div>
      </div>
    );
  }
}

export default App;
